  var markers = [
    ['KÃ¸benhavn, Denmark', 55.6760968, 12.5683371],
    ['Aalborg, Denmark', 57.046707, 9.935932],
    ['Ãrhus, Denmark', 56.162939, 10.203921],
    ['Esbjerg, Denmark', 55.476466, 8.459405],
    ['Odense, Denmark', 55.403756, 10.40237],
  ];


